import "./squadSize.css";
import { GithubPicker } from "react-color";
import { useState } from "react";

const SquadColors = ({ setSquadColors }) => {
  const [toggleColorPicker, setToggleColorPicker] = useState();

  return (
    <div>
      <div className="content">
        <p className="title">Select team design</p>
        <div className="btn-color">
          <GithubPicker>Base color</GithubPicker>
        </div>
      </div>
    </div>
  );
};

export default SquadColors;
